    true,nt"url": null,nt"notes": "<p>This report presents the results of a
    validation study of Social Security numbers (SSNs) in Medicaid Statistical Information
    System (MSIS) records for the fourth quarter of federal fiscal year 2009. The study
    presents results for the nation and the states on how often SSNs were reported in
    MSIS records and how often the reported SSNs passed a validation test at the Census
    Bureau, based on data obtained from the Social Security Administration.</p>n",nt"license_title":
